/* Reset for consistency */
* { margin: 0; padding: 0; box-sizing: border-box; }
body { font-family: 'Arial', sans-serif; font-size: 16px; }

/* Test-specific CSS */
.container {
    width: 800px;
    height: 400px;
    display: flex;
    gap: 20px;
    border: 2px solid #333;
    padding: 15px;
}
.item {
    flex: 1;
    padding: 15px;
    box-sizing: border-box;
    background-color: #f8f9fa;
    border: 1px solid #dee2e6;
    overflow: hidden;
}
h3 {
    margin-bottom: 12px;
    font-size: 16px;
    color: #495057;
    border-bottom: 2px solid #dee2e6;
    padding-bottom: 5px;
}
.content-section {
    margin: 10px 0;
    padding: 10px;
    background-color: #ffffff;
    border: 1px solid #e9ecef;
    border-radius: 4px;
}
.inline-content {
    margin: 8px 0;
    line-height: 1.4;
}
.highlight-box {
    background-color: #fff3cd;
    border: 1px solid #ffeaa7;
    padding: 8px;
    margin: 8px 0;
    border-radius: 3px;
}
ul {
    margin: 8px 0;
    padding-left: 20px;
}
li {
    margin: 3px 0;
    font-size: 13px;
}
.code-block {
    font-family: 'Courier New', monospace;
    background-color: #f8f9fa;
    border: 1px solid #dee2e6;
    padding: 8px;
    margin: 8px 0;
    font-size: 12px;
    border-radius: 3px;
}
.emphasis { font-weight: bold; color: #d63384; }
.subtle { font-size: 11px; color: #6c757d; }
a { color: #0d6efd; text-decoration: none; }
a:hover { text-decoration: underline; }
